import {useState} from "react";

const jsonData = [
  {
  key: "1",
  name: "Juan"
}, {
  key: "2",
  name: "Valeria"
}, {
  key: "3",
  name: "Max"
}, {
  key: "4",
  name: "Alfonso"
}
];

const App = () => {
  return (
    <div>
      Hola {jsonData.map((value, index) => {
        return(
          <div>
            <p>{value.name}</p>
          </div>
        );
      })}
    </div>
  );
}

export default App;
